// 方法:
// 使用自定义hash, 这样能O(n)对s的所有长度为l的子串进行hash
// 然后类似字母匹配的方式, 将间隔为l的子串视为字母, 进行匹配
class Solution {
private:
    struct Key {
        string::iterator b, e;
        size_t val = 0;
        bool operator==(const Key &k) const {
            if(val != k.val)
                return false;
            string::iterator i = b, j = k.b;
            for(; i != e && j != k.e; i++, j++)
                if(*i != *j)
                    return false;
            // return (i == e && j == k.e);
            return true;
        }
    };
    struct HashKey {
        size_t operator()(const Key &k) const noexcept { return k.val; }
    };
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        if(words.size() == 0 || s.size() == 0)
            return vector<int>();
        int W = words.size();
        int L = words[0].size();
        if(s.size() < L)
            return vector<int>();

        unordered_map<Key, int, HashKey> wcount;
        using UMIT = unordered_map<Key, int, HashKey>::iterator;
        for(auto &i : words) {
            Key k;
            k.b = i.begin(), k.e = i.end();
            int yiwei = 0;
            for(auto j = i.begin(); j != i.end(); j++) {
                k.val ^= size_t(*j-'a') << yiwei;
                yiwei = (yiwei+8)%64;
            }
            wcount[k]++;
            cout << k.val << endl;
        }
        cout << endl;

        vector<UMIT> ss;
        ss.resize(s.size());

        Key k;
        k.b = k.e = s.begin();
        int yiwei = 56;
        for(int i = 0; i < L; i++) {
            yiwei = (yiwei+8)%64;
            k.val ^= size_t(*k.e-'a') << yiwei;
            k.e++;
        }
        cout << k.val << endl;
        ss[0] = wcount.find(k);
        for(int i = 1; i <= ss.size()-L; i++) {
            k.val ^= (*k.b-'a');
            k.val = (k.val >> 8) + (k.val << 56);
            k.val ^= size_t(*k.e-'a') << yiwei;
            k.b++;
            k.e++;
            ss[i] = wcount.find(k);
                cout << k.val << endl;
        }

        vector<int> rlt;
        for(int i = 0; i < L; i++) {
            int num = wcount.size();
            int b = i, e = i;
            for(int j = 0; j < W && e < ss.size(); j++) {
                if(ss[e] != wcount.end()) {
                    switch((ss[e]->second)--) {
                    case 0: num++; break;
                    case 1: num--; break;
                    }
                }
                e += L;
            }
            if(num == 0)
                rlt.emplace_back(b);
            while(e < ss.size()) {
                if(ss[b] != wcount.end()) {
                    switch(++(ss[b]->second)) {
                    case 0: num--; break;
                    case 1: num++; break;
                    }
                }
                if(ss[e] != wcount.end()) {
                    switch((ss[e]->second)--) {
                    case 0: num++; break;
                    case 1: num--; break;
                    }
                }
                b += L, e += L;
                if(num == 0)
                    rlt.emplace_back(b);
            }
            for(; b != e; b += L)
                if(ss[b] != wcount.end())
                    ++(ss[b]->second);
        }
        return rlt;
    }
};

